import LoginPage from "./pages/LoginPage";
import HomePage from "./pages/HomePage";
import UserPage from "./pages/UserPage";
import {BrowserRouter, Route} from "react-router-dom";

function App() {
  return (
    <div>
        <BrowserRouter>
        <Route path="/" component={HomePage}/>
        </BrowserRouter>
        <UserPage />

    </div>
  );
}

export default App;
